import Vue from 'vue'
import * as constants from '../constants'

export default Vue.extend({
	name: 'login',

	data() {
		return {
			username: 'root',
			password: '',
		}
	},

	methods: {
		submit() {
			this.$store.dispatch(constants.LOGIN, {
				username: this.username,
				password: this.password,
				router: this.$router,
			})
			this.password = ''
		},
	},
})
